import React, {useState} from 'react'
import "./header.css"
import Switch from '@material-ui/core/Switch';
import FormControlLabel from '@material-ui/core/FormControlLabel';

function Header() {
    const [userTheme, setUserTheme] = useState("light")
    const handleChange = (e) =>{
        setUserTheme(e.target.checked)
    }
    return (
        <div className="header_main">
            <img className="logo_image" src="https://www.bigbasket.com/media/uploads/flatpages/freecharge/Freecharge_1000-21july.jpg" alt=""/>
            <div>
            <FormControlLabel
          control={<Switch checked={userTheme} onChange={handleChange} name="dark" />}
          label="Dark"
        />
            </div>
        </div>
    )
}

export default Header
